htmlrest.form=new function(){function n(n,t,i,r,u){$.ajax({method:n.attr("method"),url:n.attr("action"),data:n.serialize(),success:function(n,t,i){u.next(i)},error:function(n){u.next(n)}})}this.submit=function(t){return function(i,r,u,f){n(t,i,r,u,f)}};this.submitSelf=function(){return function(t,i,r,u){n(i,t,i,r,u)}}};